import React from 'react';
import Thumbnail_1 from '../img/thumbnail_1.png';
import Link from 'react-router-dom';

function Course(){
    return (
        <div className='padding-page'>
            <h2 className="secondary-title margin-small">Python Course</h2>
            <Link to='/course' className='section-button'>
                <div className="row">
                    <img src={Thumbnail_1} className='section-button__img' alt="" width="50%"/>
                <div>
                    <h3 className="tertiary-title">Section 1 - 1st October</h3>
                    <h2 className="secondary-title margin-small">Variables, Printing & Conditionals</h2>
                    <h5>Introducing python and the basics of programming</h5>
                </div>
                </div>
            </Link>
        </div>
    );
}

export default Course;
